import React, { useEffect } from "react";

const Twitter = "https://twitter.com/DeVoltreffer";
const Github = "https://github.com/VoltrefferNL";
const Linkedin = "https://www.linkedin.com/in/niels-de-visser-5b718412a/";


const IntroText = () => {
  return (
    <div>

<p>Hi, I'm <span className="bold">Niels</span>,<br></br> I am Fullstack Software Developer that has just entered the Tech space. Passionate about coding, learning new skills, travelling and riding my bike. Would you like to know more about me? Check out my projects on <span className="bold"><a href={Github} >Github</a></span>, read some of my blog post on my <span className="bold"><a href={Linkedin} >LinkedIn</a></span> or reach out on <span className="bold"><a href={Twitter} >Twitter</a></span>. 
<br></br><br></br>
I am currently updating my portfolio, please comeback soon.
</p>


    </div>
  );
};

export default IntroText;
